const getDisplayDateRange = async (param)=>{
    const con = new db();
    const {start_date, end_date} = param;
    const r = await con.run_query(`select * from report_display_view rdv where rdv.visit_date >= '${start_date}'
    and rdv.visit_date <= '${end_date}' limit 10
    `);
    con.end_connection()
    return r;
} ;

const createInsertQuery = async (table,param)=>{
    try{
        let column = Object.keys(param[0]);
    let list_column = '';
    let list_value = '';
    
    param.forEach(function(item,index) {
        let value = Object.values(item);
        let isi = value.join("','");
        if(index == 0)
        list_value += `('${isi}')`;
        else list_value += `,('${isi}')`;
    });
    
    for(let keys in column){
        list_column += `,${column[keys]} = values(${column[keys]})`;
    }

    list_column = list_column.slice(1);

    const query_col = column.join(","); 
    const sql = 
        `INSERT INTO ${table} 
            (${query_col}) VALUES 
            ${list_value}
            on duplicate key update 
            ${list_column}
        `;
    return sql;
    }catch(e){
        return e;
    }
    
}

